import {useState} from 'react';
import styled from 'styled-components';

import Header from './Header';


export default function Today(){

    return(
        <>
            <Date>
                <h2>Segunda, 17/05</h2>
                <p>Nenhuma hábito concluído ainda</p>
            </Date>
            <ConfigureHabit>
                <Habit>
                    <HabitName>
                        {'Nome do hábito'}
                    </HabitName>
                    <Days>
                        <p>Sequência atual: 4 dias</p>
                        <p>Seu recorde: 5 dias</p>
                    </Days>
                </Habit>
            </ConfigureHabit> 

        </>
    );
}

const Date = styled.div`
    height: 10vh;
    width: 100%;

    margin-top: 12vh;
    box-sizing: border-box;

    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;

    font-size: 22px;
    color: #126BA5;

        button{
            height: 40px;
            width: 40px;
            background-color:#52B6FF;

            font-size: 30px;
            font-style: bold;
            color: #FFFFFF;
        }
`;
const ConfigureHabit = styled.div`
    height: 15vh;
    width: 100%;
    background-color: #ffffff;
    color: #666666;

    border-radius: 5px;
    padding: 15px;
    box-sizing: border-box;

    margin-bottom: 10px;
    position: relative;

`;

const Habit = styled.div`
    height: 55%;
    width: 100%;

    display: flex;
    flex-direction: column;
    justify-content: space-between;
`;

const HabitName = styled.h1`
    font-size: 20px;
`;

const Days = styled.div`
    font-size: 13px;
`;
